package com.example;

import java.util.ArrayList;

public class superhuman {
    private static int idMaker;
    private int id;
    private String name;
    private double weight;
    private String height;
    private String category;
    private  int strength;
    private String pictureURL;

    ArrayList<superhuman> list = new ArrayList<>();
    

    public superhuman(String name, double weight, String height, String category, int strength, String pictureURL){
        id = ++idMaker;
        this.name = name;
        this.weight = weight;
        this.height = height;
        this.category = category;
        this.strength = strength;
        this.pictureURL = pictureURL;
    }
    public superhuman(){
        initializeList();
    }

    public int getID(){return this.id;}
    public String getName(){return this.name;}
    public double getWeight(){return this.weight;}
    public String getHeight(){return this.height;}
    public String getCategory(){return this.category;}
    public int getStrength(){return this.strength;}
    public String getURL(){return this.pictureURL;}
    
    public void initializeList(){
        list.add(new superhuman("Rudolph", 169, "5'6\"","Flying", 87, "https://cdn.pixabay.com/photo/2015/12/01/21/49/christmas-1072939_1280.jpg"));
        list.add(new superhuman("Batman", 185, "5'9\"","Water", 92, "https://www.hollywoodinsider.com/wp-content/uploads/2022/11/The-Hollywood-Insider-Batman-2-News.jpg"));
        list.add(new superhuman("Hulk", 455, "9'11\"","Strength", 99, "data:image/jpeg;base64,"));
        list.add(new superhuman("Peter", 145, "5'10\"","Spidey",78 , "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWi2b0msfkDvV2_M6i6ryYu-FB4vKIjME2YA&usqp=CAU"));
        list.add(new superhuman("Francis", 188, "5'7\"","Jesus", 99999, "data:image/jpeg;base64,"));
    }


}
